import React, { useState, useEffect } from "react";
import "../App.css";
function Home() {
  const [data, setData] = useState([]);
  const [health, sethealth] = useState("");
  const [emotions, setemotions] = useState("");
  const [personal_life, setpersonal_life] = useState("");
  const [profession, setprofession] = useState("");
  const [travel, settravel] = useState("");
  const [luck, setluck] = useState("");
  const [nex, setinex] = useState(0);

  useEffect(() => {
    const url = "https://astrohelp24.com:5030/api/fetch_horoscopes";
    fetch(url, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        lat: "1",
        lon: "1",
      }),
    })
      .then((response) => response.json())
      .then((responseJson) => {
        if (responseJson.status == true) {
          setData(responseJson.data);
          click(responseJson.data[0]);
        } else {
        }
      })
      .catch((error) => {
        //  this.hideLoading()
        console.error(error);
      });
  }, []);

  const click = (item) => {
    alert(JSON.stringify(item))
    return
    const url =
      "http://139.59.94.54/kundali_expert/astrology_api/daily_sun_sign_prediction";

    fetch(url, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        user_id: "1",
        lang: "en",
        timezone: "5.5",
        zodiacSign: item.name,
      }),
    })
      .then((response) => response.json())
      .then((responseJson) => {
        // this.hideLoading()

        if (responseJson.status == true) {
          sethealth(responseJson.responseData.prediction.health);
          setemotions(responseJson.responseData.prediction.emotions);
          setpersonal_life(responseJson.responseData.prediction.personal_life);
          setprofession(responseJson.responseData.prediction.profession);
          settravel(responseJson.responseData.prediction.travel);
          setluck(responseJson.responseData.prediction.luck);
        } else {
        }
      })
      .catch((error) => {
        console.error(error);
        // this.hideLoading()
      });
  };

  function Item(props,index) {

    return (
      <div style={{ display: "inline-block", margin: 10 }}>
        <div onClick={() => click(props)}>
          <img
            src={props.value.imageUrl}
            width="80"
            height="80"
            borderRadius="50"
          />
          <p style={{ color: "black", textAlign: "center" }}>
            {index}
          </p>
        </div>
      </div>
    );
  }

  return (
    <div>
      {data.map((item,index) => (
        <Item key={item.id} value={item} index = {index} />
      ))}

      <h1>Health </h1>
      <p>{health}</p>
      <h1>Emotions </h1>
      <p>{emotions}</p>
      <h1>Personal Life </h1>
      <p>{personal_life}</p>
      <h1>Profession </h1>
      <p>{profession}</p>
      <h1>Travel </h1>
      <p>{travel}</p>
      <h1> Luck</h1>
      <p>{luck}</p>
    </div>
  );
}

export default Home;
